y un estudio con baño completo, lo que la convierte en el hogar perfecto para familias que buscan comodidad y espacio. Con un total de 5 baños, cada uno de ellos está equipado con acabados de lujo y una sensación de elegancia. Los parqueaderos no son un problema, ya que la casa cuenta con 3 cubiertos y 3 descubiertos.\r\n\r\nEn cuanto al terreno, cuenta con 1.150 Mts2 y un área construida de 690 Mts2. El walk-in closet te brinda la sensación de estar en una tienda de lujo y las habitaciones auxiliares son super cómodas y espaciosas. La cocina es tipo americana con una hermosa isla en el medio.\r\n\r\nLa casa tiene una antigüedad de solo 6 meses y un precio de administración de $560.000 mensuales. Además, cuenta con una terraza de 100 Mts2 en el primer piso y una de 50 Mts2 en el segundo piso, que te permitirán disfrutar de vistas impresionantes de la ciudad. También tiene una zona BBQ diseñada y proyectada y 2 bodegas y cuartos útiles.\r\n\r\nTodo esto puede ser tuyo por un precio de $4.500.000.000 sin muebles','Casa Ruitoque Condominio','',0,4500000000.00,'1','Bucaramanga','Colombia','Santander','1726932071.8033.jpg','1726932071.8045.jpg','https://www.youtube.com/watch?v=FUr7UAIfB9s','7.119349','-73.1227416',11,1,0,'2024-09-21 15:21:11','2024-09-21 16:06:21','','venta-espectacular-casa-en-bucaramanga','VENTA ESPECTACULAR CASA EN BUCARAMANGA','VENTA ESPECTACULAR CASA EN BUCARAMANGA','VENTA ESPECTACULAR CASA EN BUCARAMANGA','1726932071.8039.jpg',0,'C2COBU'),(29,'9',NULL,'Exclusivo Penthouse dúplex en Milla de Oro','Venta de exclusivo Penthouse dúplex en Milla de Oro, cerca a la Av. El Poblado, Oviedo, San Fernando Plaza, Centro Comercial Santa Fe y Provenza.\r\n\r\nAdemás de tener una de las mejores ubicaciones de la ciudad, el apartamento tiene doble altura y una espectacular vista 360° desde donde se aprecia Medellín en todas las direcciones.\r\n\r\nReformado desde planos, gran diseño, áreas independientes, moderno, vanguardista, con acabados de alta calidad y cocina Italiana Santos. Además, tiene dos ascensores al piso: uno con ingreso directo y privado al apartamento y otro de uso doméstico.\r\n\r\nDomotizado, puertas de ingreso blindadas, aire acondicionado en dos de las habitaciones y con alarma. Además tiene sala de cine, gimnasio, sala de estar, estudio, bar, balcones en todas las habitaciones y una gran terraza con jacuzzi.','Milla de Oro Poblado','Milla de Oro Poblado',0,6420950000.00,'1','Medellín','Colombia','Antioquia','1726933467.4394.jpg','1726933467.4402.jpg','','6.2476376','-75.56581530000001',11,1,0,'2024-09-21 15:44:27','2024-09-21 23:47:28','Daily','exclusivo-penthouse-duplex-en-milla-de-oro','Exclusivo Penthouse dúplex en Milla de Oro','Exclusivo Penthouse dúplex en Milla de Oro','Exclusivo Penthouse dúplex en Milla de Oro','1726933467.4398.jpg',0,'C9COME'),(30,'2',NULL,'Casa la Calera conjunto  Sikasue','La Calera Casa en Arriendo Condomio Sikasue $15.000.000  Incluida administración\r\nUbicada en la vía a la Calera km 8 condominio Sikasue\r\nEs una casa con un área privada de 3.800 m2 y y un área de construcción de 1300 m2, consta de 6 habitaciones cada una con baño privado y balcón, asi como closet amplio, la principal tiene jacuzzi, sala de desayuno y un vestier muy amplio, es de 3 pisos y sótano el primer piso es área social, sala con chimenea, salón de juegos con calentador a gas, comedor principal y auxiliar cocina integral a gas cuarto de lavandería y cuarto de servicio con baño privado, piscina climatizada, baño turco, sala de cine. En el 2 piso hay 3 habitaciones y sala de estar y en el 3 otras 3 habitaciones incluida la principal, en el sótano están las calderas, 3 garajes cubiertos y zona de herramientas, en la parte trasera de la casa hay un apto para conductor, cuenta con planta eléctrica y otras cosas más importantes.','Casa la calera Condomio Sikasue','',1,15000000.00,'1','Bogotá','Colombia','Bogotá','1726934494.7534.jpg','1726934494.7541.jpg','','4.710988599999999','-74.072092',11,1,0,'2024