ar que equilibra a la perfección la modernidad con la funcionalidad, ofreciendo espacios pensados para la vida cotidiana.\r\n\r\nCocina Integrada: Disfruta de una cocina que se fusiona con la sala y el comedor, facilitando la interacción y creando un ambiente acogedor.\r\n\r\nEspacios Verdes para Disfrutar: Relájate al aire libre en tu propio espacio verde, perfecto para momentos familiares y momentos de paz.\r\n\r\nHabitaciones Diseñadas para el Confort: Tres habitaciones que ofrecen comodidad sin excesos, proporcionando un refugio tranquilo para el descanso.\r\n\r\nDetalles Personalizables: Esta casa te brinda la oportunidad de personalizar algunos detalles para que se ajusten a tus gustos personales.','Casa Ruitoque','',0,2500000000.00,'1','Bucaramanga','Colombia','Santander','1727134618.7428.jpg','1727134618.7444.jpg','https://www.youtube.com/watch?v=ri3D_U6YnR4','7.119349','-73.1227416',203,1,0,'2024-09-23 23:36:58','2024-09-23 23:37:38','','casa-ruitoque-condominio-bucaramanga-en-venta','Espectacular Casa en Venta Ruitoque','Descubre la comodidad en esta impresionante casa de lujo, una obra maestra arquitectónica que redefine la experiencia de vivir. Desde el momento en que pones un pie en este oasis de 467 metros cuadrados construidos, te envolverá una sensación de grandeza y distinción que solo esta casa puede ofrecer. Diseño de un Solo Nivel: Esta casa de lujo ha sido inteligentemente diseñada en un solo nivel, un atributo que la hace especialmente atractiva.','Descubre la comodidad en esta impresionante casa de lujo en Bucaramanga.','1727134618.7437.jpg',0,'C2COBU'),(37,'3',0,'Espectacular Apto Icon Beach','“LUJO DISCRETO, VISTAS EXTRAORDINARIAS.”\r\nBienvenido a un hogar y una comunidad, un destino y un lugar de retiro, con conserje exclusivo, recepcionista las 24 horas, valet parking y seguridad. Nuestro equipo de expertos está a su disposición para atenderlo con todo lo que necesite.\r\n\r\nituadas en la maravillosa y soleada costa de Hollywood, las residencias ofrecen una perspectiva sofisticada e innovadora de la vida junto al mar, con impresionantes vistas al océano Atlántico y a los canales de Hollywood Beach.\r\n\r\nEspacios interiores refinados y reconfortantes, frescos y minimalistas, realzados con exquisitos tonos marítimos y texturas orgánicas que se funden con el entorno natural.\r\n\r\nUbicación\r\nUna ubicación perfecta, entre la energía cosmopolita de Miami y la serena elegancia de Fort Lauderdale, con extraordinarias vistas a un mar azul turquesa.\r\n\r\nUbicadas en un enclave tranquilo a lo largo de la costa de ensueño e iluminada por el sol de Hollywood, Icon Beach Residences refleja una nueva visión elevada de la vida en el agua con extraordinarias vistas del océano y del canal intracostero. Perfectamente ubicado entre la energía global de Miami y la tranquila elegancia de Fort Lauderdale, The Residences alberga un puerto deportivo exclusivo y un club de playa de servicio completo con vistas a los paisajes marinos más extraordinarios de Hollywood: un refugio acogedor de estilo impecable en un entorno naturalmente hermoso frente al mar.\r\n\r\nHollywood ofrece una extensa gama de actividades para deleitarse tanto en espacios interiores como al aire libre: paseos en yate, vida nocturna, compras y golf de clase mundial.\r\n\r\nLas residencias también están a pocos minutos de campos de golf de campeonato, tiendas de lujo, restaurantes de lujo, vida nocturna ecléctica, un sinfín de actividades al aire libre, y a un corto trayecto en coche de los aeropuertos internacionales de Miami y Fort Lauderdale.\r\n\r\nDescripción General del Proyecto\r\nIcon Beach es fruto de una innovadora colaboración de visionarios de la industria, reconocidos diseñadores de interiores y arquitectos locales de larga trayectoria.\r\n\r\n38 plantas con 350 viviendas, diseñadas por Meyer Davis.\r\nImpresionante ubicación frente al mar: Situada a lo largo de la pintoresca costa de Hollywood, Icon Hollywood Beach ofrece a los residentes vistas incomparables del océano y del canal intracostero.\r\nLobby de lujo: El vestíbulo da la bienvenida a residentes e invitados por igual y presenta un diseño sofisticado, una puerta cochera y servicios de conserjería, valet y seguridad las 24 horas.\r\nComodidades\r\nIcon Beach ofrece más de 3700 metros cuadrados de comodidades, incluyendo el acceso a una marina y el uso de un club de playa con todos los servicios y vistas a los impresionantes paisajes marinos de Hollywood. Pase el día en la piscina, revitalícese en nuestro wellness center, recargue energías en el gimnasio y relájese en el lujo de una vida junto al mar.\r\n\r\nAmplia y espectacular piscina con solárium y elegantes cabañas.\r\nGimnasio de última generación de 279 metros cuadrados, con salas de yoga, bicicletas y avanzados equipos para hacer ejercicios de cardio y entrenamiento con pesas.\r\nSpa y wellness center para relajarse, con tina de inmersión fría, cuarto de sauna y jacuzzi para restablecer el equilibrio del cuerpo y la mente.\r\nAmplio salón de reuniones para los residentes y bar de cocteles al aire libre para celebrar y brindar.\r\nCésped exclusivo para ejercicios.\r\nCine al aire libre para noches de cine con la familia y los amigos.\r\nEspacio reservable para eventos, con vistas a los canales de Hollywood Beach.\r\nEspacios con un paisajismo impecable, incluyendo una terraza para disfrutar del atardecer con un área de césped para hacer yoga y ejercicios al aire libre.\r\nMercado y cafetería gourmet solo para residentes: Ofreciendo comodidad y lujo, los residentes tienen acceso a un mercado y una cafetería en el lugar para las necesidades diarias y delicias.\r\nClub de playa de servicio completo: los residentes disfrutan de acceso exclusivo a un club de playa con arenas cristalinas y muchas comodidades junto a la playa para el ocio y la recreación (el club de playa al que aquí se hace referencia no está ubicado en el Condominio, sino fuera de sus instalaciones. Está previsto que el acceso se otorgue por medio de un acuerdo independiente con terceros y puede ser por un período limitado).\r\nCaracterísticas de las residencias\r\nResidencias que incluyen desde una hasta tres habitaciones con espectaculares vistas al agua, amplios balcones privados y abundante luz natural.\r\n\r\nLos interiores de Meyer Davis se caracterizan por un lujo discreto, líneas limpias y fluidas, y acabados impactantes que proporcionan una sensibilidad sofisticada y serena a cada uno de los espacios. La paleta es suave y minimalista, con exquisitos detalles marítimos que crean un refinado contraste entre la belleza del paisaje y un diseño impecable.\r\n\r\nExtraordinarias vistas del océano Atlántico y de los canales de Hollywood Beach.\r\nAmplios balcones privados con puertas corredizas de vidrio que van de piso a techo.\r\nHabitaciones principales espaciosas y con buena ventilación, llenas de luz natural y decoradas con emblemáticos detalles marítimos en una paleta cálida y minimalista.\r\nCocinas gourmet de Meyer Davis con gabinetes italianos personalizados, amplias islas de cocina y encimeras de porcelana importada, en dos combinaciones de colores a elegir.\r\nElectrodomésticos Bosch y Thermador de alta gama, incluyendo refrigerador, placa de inducción, horno, horno rápido y lavavajillas.\r\nBaños principales estilo spa, equipados con elegantes bañeras y accesorios de Kohler y Hansgrohe.\r\nVestidores espaciosos y meticulosamente diseñados.','Florida, EE. UU.','3724 S Ocean Dr',0,825.00,'0','','Estados Unidos','Florida','MIAMI_1_1727806254.jpg','MIAMI_2_1727806254.jpg','','27.6648274','-81.5157535',0,1,0,'2024-10-01 16:10:54','2024-10-01 17:20:26','Daily','espectacular-apto-icon-beach','Espectacular Apto Icon Beach','“LUJO DISCRETO, VISTAS EXTRAORDINARIAS.”\r\nBienvenido a un hogar y una comunidad, un destino y un lugar de retiro, con conserje exclusivo, recepcionista las 24 horas, valet parking y seguridad. Nuestro equipo de expertos está a su disposición para atenderlo con todo lo que necesite.','Espectacular Apto Icon Beach',NULL,0,NULL),(38,'3',0,'Hermoso Apto Visions Brickell','Visions Brickell\r\n«La vida en el distrito de Brickell es dinámica.”\r\nLos propietarios pueden disponer de la unidad a su discreción, alquilarla a través de múltiples plataformas o adherirse al Programa Hotelero administrado de forma profesional para optimizar los resultados.\r\n\r\nVisions at Brickell Station condo-hotel es la última adición al atractivo y fascinante distrito de Brickell.\r\n\r\nLa marca de Visions fue diseñada por UNCG, un desarrollador que se especializa en la construcción de comunidades sustentables y con un gran énfasis en Wellness. Las unidades cuentan con lujosos servicios enfocados en el bienestar, que incluyen sistemas avanzados de calefacción con aire purificado y difusión de eco-desinfectante probiótico, revestimientos de paredes no tóxicos, agua filtrada, difusores de aromaterapia, duchas de terapia de vitamina C e iluminación para relajar y equilibrar la mente.\r\n\r\nUbicación\r\nUna comunidad peatonal que hoy en día se ha convertido en uno de los centros urbanos más codiciados de la ciudad, ubicada en el corazón de Miami. Restaurantes, tiendas, parques y hoteles a poca distancia y de fácil acceso para el transporte público.\r\n\r\nBrickell está cargado de un gran significado cultural, con sus tiendas de lujo y restaurantes de alta cocina atrae a ese ciudadano sofisticado y viajero que busca visitar, trabajar y divertirse en el estimulante epicentro de Miami Brickell City Centre. Este complejo comercial y gastronómico de lujo al aire libre capta la atención de residentes locales y turistas internacionales por sus boutiques de alta categoría, opciones de entretenimiento, galerías de arte y elegantes restaurantes.\r\n\r\nDescripción General del Proyecto\r\nVisions at Brickell Station, con ocho pisos, es un condo-hotel boutique de 111 unidades que abarcan desde estudios hasta unidades de una habitación sin ningún tipo de restricción para alquiler.\r\n\r\nVestíbulo con techos altos.\r\nTanto el edificio como las residencias cuentan con sistemas avanzados de calefacción y ventilación que proporcionan aire purificado y difusión de eco-desinfectante probiótico para ayudar a eliminar las bacterias y virus de la atmósfera y las superficies.\r\nDifusores de aromaterapia.\r\nIluminación para relajar y equilibrar la mente.\r\nComodidades\r\nUn gimnasio de última generación con equipo de gimnasio interactivo, piscina infinita y terraza en la azotea, restaurante en el lugar con servicio de alimentos y bebidas, check-in en recepción, servicios de lavandería y un programa de bicicletas compartidas son solo algunas de las características distintivas que mejoran la experiencia de ser propietario en Visions at Brickell Station.\r\n\r\nRooftop con piscina infinita.\r\nRestaurant & Bar con terraza exterior.\r\nEquipo de gimnasio interactivo.\r\nServicio de lavandería.\r\nValet Parking.\r\nEarly check-in / late check-out opcional.\r\nSeguridad 24/7.\r\nServicio diario de limpieza.\r\nServicio de conserjería.\r\nServicio a la habitación.\r\nAlmacenamiento de equipaje.\r\nServicio de transporte (Aeropuerto & Brightline).\r\nBicicletas.\r\nDuchas de terapia de vitamina C.\r\nCaracterísticas de las residencias\r\nAcceso digital.\r\nEncimeras de cuarzo.\r\nBaldosas de cerámica imitación madera.\r\nVentanas de suelo a techo.\r\nGabinetes de cocina italianos.\r\nSmart TV de 75”.','Miami, Florida, EE. UU.','1136 SW 3rd Ave, Miami, Florida 33145, EE. UU',0,500000.00,'0','Miami','Estados Unidos','Florida','2MIAMI_2_1727811030.jpg','2MIAMI_3_1727811030.jpg','','25.7616798','-80.1917902',0,1,0,'2024-10-01 17:30:30','2024-10-01 17:31:40','Daily','hermoso-apto-visions-brickell','Hermoso Apto Visions Brickell','Visions Brickell\r\n«La vida en el distrito de Brickell es dinámica.”\r\nLos propietarios pueden disponer de la unidad a su discreción, alquilarla a través de múltiples plataformas o adherirse al Programa H