INSERT INTO `seo_settings` VALUES (2,'all-categories','1746370438.0174.jpg','Casas y Apartamentos en Venta | Inmobiliaria Roca Romana','Descubre las mejores casas y apartamentos en venta con Inmobiliaria Roca Romana. Encuentra propiedades exclusivas en Colombia, perfectas para inversión o hogar','casas en venta, apartamentos en venta, inmobiliaria Roca Romana, propiedades en Colombia, bienes raíces Colombia, apartamentos en Bogotá, venta de casas, inversión inmobiliaria, propiedades exclusivas, viviendas en Colombia','2025-05-04 12:53:58','2025-05-04 12:53:58'),(3,'homepage','1746370725.8558.jpg','Propiedades en Venta en Colombia | Inmobiliaria Roca Romana','Propiedades en Venta en Colombia | Inmobiliaria Roca Romana','propiedades en Colombia, inmuebles en venta, apartamentos Bogotá, casas en venta, compra de propiedades, bienes raíces Colombia, viviendas en venta, inversión inmobiliaria, propiedades exclusivas, casas familiares en Colombia','2025-05-04 12:58:45','2025-05-04 12:58:45'),(4,'about-us','1746370955.9549.jpg','propiedades en Colombia, inmuebles en venta, apartamentos Bogotá, casas en venta, compra de propiedades, bienes raíces Colombia, viviendas en venta, inversión inmobiliaria, propiedades exclusivas, casas familiares en Colombia','En Inmobiliaria Roca Romana, nos dedicamos a ofrecerte las mejores opciones en propiedades en venta en Colombia. Con años de experiencia en el sector inmobiliario, nos especializamos en ayudarte a encontrar tu hogar ideal o realizar una inversión inmobiliaria exitosa','acerca de Inmobiliaria Roca Romana, empresa inmobiliaria en Colombia, expertos en bienes raíces, venta de propiedades en Colombia, equipo inmobiliario, asesoría inmobiliaria, compra de propiedades, inversión inmobiliaria en Colombia, Inmobiliaria Roca Romana experiencia','2025-05-04 13:02:35','2025-05-04 13:02:35'),(5,'articles','1746371073.0413.jpg','Artículos y Noticias Inmobiliarias | Roca Romana','Descubre los mejores artículos y noticias del mercado inmobiliario en Colombia. Mantente informado con consejos, tendencias y análisis de propiedades, inversiones y más, en el blog de Inmobiliaria Roca Romana','artículos inmobiliarios, noticias del mercado inmobiliario, blog Roca Romana, tendencias en bienes raíces, consejos inmobiliarios, inversión en propiedades, noticias inmobiliarias Colombia, análisis del mercado inmobiliario, compra y venta de propiedades','2025-05-04 13:04:33','2025-05-04 13:04:33'),(6,'chat','1746371160.6231.jpg','Chat en Vivo | Asesoría Inmobiliaria Roca Romana','Tienes dudas sobre propiedades en venta o necesitas asesoría personalizada? Conéctate en tiempo real con un experto de Inmobiliaria Roca Romana a través de nuestro chat en vivo y recibe respuestas inmediata','chat en vivo, asesoría inmobiliaria en línea, chat inmobiliaria, atención al cliente en vivo, chat Roca Romana, asesoramiento sobre propiedades, contacto en tiempo real, dudas sobre bienes raíces, atención en línea inmobiliaria','2025-05-04 13:06:00','2025-05-04 13:06:00'),(7,'contact-us','1746371230.5952.jpg','Contáctanos | Inmobiliaria Roca Romana','Tienes alguna consulta o necesitas más información sobre nuestras propiedades en venta? Ponte en contacto con Inmobiliaria Roca Romana. Estamos disponibles para ayudarte a encontrar la propiedad ideal en Colombia','contacto inmobiliaria, contáctanos Roca Romana, consulta propiedades, atención al cliente inmobiliaria, dudas sobre propiedades, información inmobiliaria, contacto ventas inmobiliarias, asesores inmobiliarios, cómo contactar Inmobiliaria Roca Romana','2025-05-04 13:07:10','2025-05-04 13:07:10'),(8,'featured-properties','1746371427.3887.jpg','Propiedades Destacadas en Venta | Inmobiliaria Roca Romana','Explora nuestras propiedades destacadas en venta, seleccionadas especialmente por su excelente ubicación, diseño y precio. Encuentra las mejores oportunidades en bienes raíces en Colombia con Inmobiliaria Roca Romana','propiedades destacadas, propiedades en venta, inmuebles destacados, casas destacadas, apartamentos destacados, bienes raíces en Colombia, propiedades exclusivas, ofertas inmobiliarias, inversión en propiedades, inmuebles de lujo','2025-05-04 13:10:27','2025-05-04 13:10:27'),(9,'properties-on-map','1746371690.6851.jpg','Propiedades en el Mapa | Inmobiliaria Roca Romana','Descubre las propiedades disponibles en venta en Colombia de manera fácil y visual a través de nuestro mapa interactivo. Filtra según tu ubicación y encuentra las mejores opciones cercanas a ti con Inmobiliaria Roca Romana','propiedades en el mapa, mapa interactivo inmobiliario, propiedades en venta en mapa, bienes raíces Colombia, ubicación de propiedades, inmuebles cerca de mí, mapa de propiedades en venta, búsqueda de propiedades en mapa, encontrar propiedades en Colombia','2025-05-04 13:14:50','2025-05-04 13:14:50'),(10,'most-viewed-properties','1746371912.442.png','Propiedades Más Vistas | Inmobiliaria Roca Romana','Explora las propiedades más vistas en nuestro portal y descubre las opciones más populares y solicitadas en Colombia. Encuentra las mejores oportunidades de inversión o tu futuro hogar con Inmobiliaria Roca Romana','propiedades más vistas, inmuebles populares, propiedades más solicitadas, casas más vistas, apartamentos más vistos, propiedades en Colombia, inmuebles populares en Colombia, tendencias inmobiliarias, propiedades en venta populares, lo más visto en bienes raíces','2025-05-04 13:18:32','2025-05-04 13:18:32'),(11,'most-favorite-properties','1746372023.1471.jpg','Propiedades Más Favoritas | Inmobiliaria Roca Romana','Descubre las propiedades más favoritas de nuestros usuarios. Explora las opciones más apreciadas y destacadas en Colombia, desde casas hasta apartamentos, y encuentra tu propiedad ideal con Inmobiliaria Roca Romana','propiedades favoritas, inmuebles preferidos, casas más favoritas, apartamentos más favoritos, propiedades en venta favoritas, inmuebles más apreciados, propiedades más populares, favoritos en bienes raíces, propiedades destacadas en Colombia','2025-05-04 13:20:23','2025-05-04 13:20:23'),(12,'privacy-policy','1746372101.1763.jpg','Política de Privacidad | Inmobiliaria Roca Romana','Conoce cómo protegemos y utilizamos tus datos personales en Inmobiliaria Roca Romana. Nuestra política de privacidad garantiza transparencia y seguridad en el uso de tu información mientras navegas y utilizas nuestro portal','política de privacidad, privacidad de datos, protección de datos personales, uso de información personal, seguridad de datos, privacidad en bienes raíces, términos de privacidad, datos en portales inmobiliarios, confidencialidad de usuarios','2025-05-04 13:21:41','2025-05-04 13:21:41'),(13,'all-properties','1746372231.3321.jpg','Todas las Propiedades en Venta | Inmobiliaria Roca Romana','Explora todas las propiedades disponibles en Colombia: casas, apartamentos, fincas y más','todas las propiedades, propiedades en venta, inmuebles en Colombia, casas disponibles, apartamentos en venta, bienes raíces Colombia, buscar propiedades, listado de propiedades, catálogo inmobiliario, propiedades disponibles','2025-05-04 13:23:51','2025-05-04 13:23:51'),(14,'properties-nearby-city','1746372332.1023.jpg','Propiedades Cercanas a la Ciudad | Inmobiliaria Roca Romana','Encuentra propiedades en venta cerca de tu ciudad con opciones ideales para vivir o invertir','propiedades cerca de la ciudad, inmuebles urbanos, casas cercanas, apartamentos cerca, propiedades en venta, bienes raíces Colombia, vivir cerca del centro, inmuebles por ubicación','2025-05-04 13:25:32','2025-05-04 13:25:32'),(15,'search','1746372406.341.jpg','Buscar Propiedades | Inmobiliaria Roca Romana','Utiliza nuestro buscador para encontrar propiedades en venta en Colombia según tus preferencias','buscar propiedades, buscador inmobiliario, búsqueda de casas, apartamentos en venta, filtros de búsqueda, encontrar inmuebles, portal inmobiliario Colombia','2025-05-04 13:26:46','2025-05-04 13:26:46'),(16,'subscription-plan','1746372488.3641.jpg','Planes de Suscripción | Inmobiliaria Roca Romana','Conoce nuestros planes de suscripción y publica tus propiedades con mayor visibilidad en el porta','planes de suscripción, publicar propiedades, promoción inmobiliaria, suscripción inmobiliaria, aumentar visibilidad, portal inmobiliario Colombia','2025-05-04 13:28:08','2025-05-04 13:28:08'),(17,'terms-and-condition','1746372559.1122.jpg','Términos y Condiciones | Inmobiliaria Roca Romana','Revisa los términos y condiciones para usar nuestro portal y publicar o buscar propiedades','términos y condiciones, condiciones de uso, reglas del portal, políticas inmobiliarias, uso del sitio web, normativa usuarios, portal inmobiliario Colombia','2025-05-04 13:29:19','2025-05-04 13:29:19'),(18,'profile','1746372617.0948.jpg','Mi Perfil | Inmobiliaria Roca Romana','Accede y gestiona tu perfil, propiedades guardadas y actividad dentro del portal inmobiliario','perfil de usuario, cuenta inmobiliaria, mi cuenta, gestionar perfil, propiedades guardadas, usuario registrado, actividad en portal, portal inmobiliario Colombia','2025-05-04 13:30:17','2025-05-04 13:30:17'),(19,'user-register','1746372791.6475.jpg','Registro de Usuario | Inmobiliaria Roca Romana','Regístrate en nuestro portal inmobiliario para acceder a todas las propiedades y gestionar tu cuenta','registro de usuario, crear cuenta, registrarse portal inmobiliario, acceder a propiedades, cuenta inmobiliaria, portal inmobiliario Colombia, usuarios registrados','2025-05-04 13:33:11','2025-05-04 13:33:11');
