n<ol>\r\n<ol>\r\n<ol>\r\n<li>Garantizar que ninguna de las piezas, im&aacute;genes, textos, fotos, videos publicados en WWW.ROCAROMANA.CO en su portal web-m&oacute;vil y aplicaciones (Android e IOS), afecta derechos de terceros, as&iacute; sean trabajadores o contratistas del mismo cliente. Asimismo, EL CLIENTE garantiza que la informaci&oacute;n, las piezas, fotos, videos a publicar no constituyen publicidad enga&ntilde;osa o actos de competencia desleal. En cualquier caso, EL CLIENTE mantendr&aacute; indemne a ROCA ROMANA S. ante cualquier reclamo por usos no autorizados de materiales como obras, programas de computador, marcas o ante el reclamo de consumidores o competidores afectados por la calidad objetiva, la veracidad, la actualidad o la idoneidad de los contenidos publicados.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>Asumir las consecuencias legales a que den lugar sus publicaciones en WWW.ROCAROMANA.CO (en su portal web-m&oacute;vil y/o aplicaciones Android e IOS), generando de esta forma publicidad enga&ntilde;osa al consumidor final; constituy&eacute;ndose en el responsable directo por las reclamaciones y/o demandas relacionadas y garantizando mantener indemne a ROCA ROMANA . ante las mismas.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>EL CLIENTE reconoce su deber de informarse sobre cada uno de los productos y/o servicios que adquiere a trav&eacute;s de los portales y/o plataformas de ROCA ROMANA ; motivo por el cual deber&aacute; considerar en detalle las descripciones, publicidad, condiciones aplicables a cada servicio y/o producto.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>Conocer y cumplir las pol&iacute;ticas de publicaci&oacute;n que le sean aplicables de acuerdo a estos mismos t&eacute;rminos y condiciones.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>El incumplimiento de las obl