termedio de terceros, crear nuevos productos o servicios derivados de la informaci&oacute;n y elementos contenidos en la p&aacute;gina. Lo anterior tambi&eacute;n aplicar&aacute;, para dise&ntilde;os, marcas, gr&aacute;ficos, im&aacute;genes, que aparezcan en el portal web, pertenecientes a empresas, entidades o personas naturales colaboradoras o contratantes con ROCA ROMANA ,salvo el consentimiento expreso de las mismas, el que en todo caso deber&aacute; constar por escrito.</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<li>PRODUCTOS Y SERVICIOS DE TERCERAS PERSONAS:<br /><br /><br /></li>\r\n</ol>\r\n<p>El usuario acepta que al pulsar en los enlaces (links), que lo conecten a webs de terceras empresas o personas naturales, deja de navegar en WWW.ROCAROMANA.CO, exonerando a la misma de cualquier responsabilidad, da&ntilde;o o perjuicio en la contrataci&oacute;n con las terceras empresas. El usuario deja de navegar en ROCAROMANA.CO, cuando en el portal web &ndash; m&oacute;vil y aplicaciones (Android e IOS) enlazada no aparezca la marca ROCA ROMANA, cualquiera de sus marcas, o el nombre comercial ROCA ROMANA.y la direcci&oacute;n o nombre de dominio no tenga incluida la palabra ROCA ROMANA</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<li>RESPONSABILIDAD DE ROCAROMANA.CO:<br /><br /><br /></li>\r\n</ol>\r\n<p>Tanto el portal web de internet como su contenido son de propiedad de ROCA ROMANA, cuya funci&oacute;n principal es la de ser un medio o canal de informaci&oacute;n, de forma que no se otorga garant&iacute;a alguna, expresa, parcial, total o impl&iacute;cita, sobre la precisi&oacute;n, exactitud, confiabilidad u oportunidad de la informaci&oacute;n o del material all&iacute; incluido. No existe tampoco respecto de la informaci&oacute;n que en el portal web &ndash; m&oacute;vil y aplicaciones (Android e IOS) se encuentra, recomendaci&oacute;n, asesor&iacute;a o consejo al usuario, por tanto las decisiones que se relacionen con dicha informaci&oacute;n o publicidad, ser&aacute;n de cuenta y riesgo exclusivo del usuario.</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<li>PROTECCI&Oacute;N DE DATOS PERSONALES :<br /><br /><br /></li>\r\n</ol>\r\n<p>El sitio WWW.ROCAROMANA.CO y sus aplicaciones son propiedad de ROCA ROMANA, empresa identificada con NIT: 901657376-2,. Esta pol&iacute;tica de privacidad es parte integrante de los T&eacute;rminos y Condiciones de WWW.ROCAROMANA.CO, y est&aacute; vigente desde el 05 de junio &nbsp;de 2024</p>\r\n<p>La pol&iacute;tica de privacidad y protecci&oacute;n de datos personales puede ser consultada dentro del sitio a trav&eacute;s del siguiente enlace:&nbsp;<a href=\"https://www.fincaraiz.com.co/informacion#politica_tratamiento_de_datos_personales\">pol&iacute;tica de tratamiento de datos personales.</a></p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<li>Cookies:<br /><br /><br /></li>\r\n</ol>\r\n</ol>\r\n<p>El usuario y/o quienes ingresen al portal web - m&oacute;vil y/o aplicaciones (Android e IOS) ROCAROMANA.CO han le&iacute;do, conocen y aceptan que ROCAROMANA.CO podr&aacute; utilizar un sistema de seguimiento mediante la utilizaci&oacute;n de cookies (denominadas las &ldquo;Cookies&rdquo;). Las Cookies son peque&ntilde;os archivos que autom&aacute;ticamente se instalan en el disco duro, con una duraci&oacute;n limitada en el tiempo que ayudan a personalizar los servicios.</p>\r\n<p><br /><br /></p>\r\n<p>Tambi&eacute;n ofrecemos importantes funcionalidades que s&oacute;lo est&aacute;n disponibles mediante el empleo de Cookies. Las Cookies se utilizan con el fin de conocer los intereses, el comportamiento y la demograf&iacute;a de quienes visitan nuestro portal Web &ndash; m&oacute;vil y/o aplicaciones (Android e IOS) y de esa forma, comprender mejor sus necesidades e intereses y darles un mejor servicio o proveerle informaci&oacute;n relacionada.</p>\r\n<p>Tambi&eacute;n usaremos la informaci&oacute;n obtenida por intermedio de las Cookies para analizar las p&aacute;ginas navegadas por el visitante o usuario, las b&uacute;squedas realizadas, mejorar nuestras iniciativas comerciales y promocionales, mostrar publicidad o promociones, banners de inter&eacute;s, noticias sobre ROCAROMANA.CO, perfeccionar nuestra oferta de contenidos y art&iacute;culos, personalizar dichos contenidos, presentaci&oacute;n y servicios; tambi&eacute;n podremos utilizar Cookies para promover y hacer cumplir las reglas y seguridad del sitio. ROCAROMANA.CO podr&aacute; agregar Cookies en los e-mails que env&iacute;e para medir la efectividad de las promociones.<br /><br /></p>\r\n<ol>\r\n<li>MODIFICACI&Oacute;N Y VALIDEZ DE LOS T&Eacute;RMINOS Y CONDICIONES:<br /><br /><br /></li>\r\n</ol>\r\n<p>WWW.ROCAROMANA.CO podr&aacute; modificar unilateralmente total o parcialmente la pol&iacute;tica de t&eacute;rminos y condiciones aplicables, informando oportunamente a los usuarios sobre el cambio. Para tal fin, WWW.ROCAROMANA.CO publicar&aacute; en el sitio los cambios y su fecha de aplicaci&oacute;n con la anticipaci&oacute;n necesaria para que los usuarios puedan tener acceso a los mismos. El usuario que no acepte las nuevas condiciones establecidas en la pol&iacute;tica, notificar&aacute; a WWW.ROCAROMANA.CO en <a href=\"mailto:servicio.cliente@rocaromana.com\">servicio.cliente@rocaromana.co</a> &nbsp;para que se le d&eacute; de baja como usuario registrado; en caso de no recibir notificaci&oacute;n alguna por parte de los usuarios, WWW.ROCAROMANA.COM podr&aacute; v&aacute;lidamente aplicar la nueva pol&iacute;tica a dichos usuarios.</p>\r\n<p><br /><br /></p>\r\n<p>Los usuarios y WWW.ROCAROMANA.CO aceptan y reconocen que en el caso en el que alguna de las disposiciones de los t&eacute;rminos y condiciones sea declarada ineficaz parcialmente, nula o inv&aacute;lida por la jurisdicci&oacute;n competente, las dem&aacute;s cl&aacute;usulas y obligaciones conservar&aacute;n su validez.</p>\r\n<p><br /><br /></p>\r\n<p>Estos t&eacute;rminos y condiciones vincular&aacute;n a las partes desde el momento en que EL CLIENTE los acepte d&aacute;ndose de alta en cualquiera de los sistemas o plataformas de &nbsp;ROCA ROMANA as&iacute; como haciendo uso de los mismos.</p>\r\n<p><br /><br /></p>\r\n<p>EL CLIENTE reconoce su deber de informarse sobre cada uno de los productos y/o servicios que adquiere a trav&eacute;s de los portales y/o plataformas de ROCA ROMANA; motivo por el cual deber&aacute; considerar en detalle las descripciones, publicidad, condiciones aplicables a cada servicio y/o producto.</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<li>POL&Iacute;TICA DE PUBLICACI&Oacute;N DE CONTENIDO:<br /><br /><br /></li>\r\n<ol>\r\n<li>Contenido prohibido para la publicaci&oacute;n<br /><br /><br /></li>\r\n</ol>\r\n</ol>\r\n<p>Para los usuarios del portal web-m&oacute;vil y aplicaciones (Android e IOS), que adem&aacute;s deseen publicar avisos clasificados, se establecen las siguientes restricciones de contenido:</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>Contenido alusivo a menores de edad, es decir aquellos solicitados en favor de adultos y/o empleo.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>Contenido exclusivo para mayores de edad, tales como aquellos alusivos a &oacute;rganos reproductivos de la mujer y/o el hombre o pr&aacute;cticas sexuales espec&iacute;ficas.</li>\r\n<li>Aquellos relacionados con servicios de car&aacute;cter sexual.</li>\r\n<li>Contenido relacionado con la comercializaci&oacute;n de armas de fuego, aun aquellas que se consideren como &ldquo;antig&uuml;edad&rdquo;.</li>\r\n<li>Los que tengan que ver con la comercializaci&oacute;n de &oacute;rganos del cuerpo.</li>\r\n<li>Contenido alusivo a medicamentos o tratamientos para la salud, as&iacute; como contenido alusivo al uso, compra, venta, producci&oacute;n o consumo de drogas recreativas o que generen dependencia.</li>\r\n<li>Aquellos tendientes a afectar el buen nombre de una persona o entidad, o que tengan dejos discriminatorios o racistas.</li>\r\n<li>Contenido relacionado con la comercializaci&oacute;n de derechos de autor y afines, tales como grabaciones, programas de televisi&oacute;n y radio, libros, revistas etc.</li>\r\n<li>Avisos relacionados con la comercializaci&oacute;n de animales.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<li>Restricciones para las publicaciones de los usuarios<br /><br /><br /></li>\r\n<ol>\r\n<li>Los usuarios persona natural, podr&aacute;n publicar m&aacute;ximo 10 avisos de inmuebles usados para venta o arriendo de manera gratuita. Un mismo cliente no puede publicar el mismo aviso m&aacute;s de una vez. Las publicaciones que incluyan alguno de los siguientes servicios tendr&aacute;n costo: Asciende, turbo, destacado, etiqueta, cupo extendido, aviso vacacional.<br />Este usuario acepta y reconoce su deber de informarse sobre las caracter&iacute;sticas de los productos de publicaci&oacute;n gratis.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>Los agentes inmobiliarios y emprendedores, no pueden publicar avisos de manera gratuita. Y en todo caso deben suscribir un contrato por los servicios que requieran.</li>\r\n<li>Los avisos de inmuebles vacacionales no se pueden publicar de manera gratuita, este tipo de avisos siempre tendr&aacute;n un costo de publicaci&oacute;n.</li>\r\n<li>Los usuarios Constructoras no pueden publicar inmuebles usados para la venta o arriendo excepto cuando tambi&eacute;n ostenten la calidad de agente intermediario y emprendedor y suscriba un contrato de servicios con Editora Urbana Ltda.</li>\r\n<li>El usuario Constructora ser&aacute; el &uacute;nico autorizado para la publicaci&oacute;n de proyectos nuevos en donde el mismo o un patrimonio aut&oacute;nomo inicial mantengan el control y responsabilidad del inmueble; incluye proyectos sobre planos y/o en construcci&oacute;n; inmuebles nuevos o para estrenar.</li>\r\n<li>Los otros tipos de usuarios institucionales, que dentro de sus unidades de negocio registran la necesidad de publicar inmuebles para venta o arriendo (remates o daciones en pago), deber&aacute;n suscribir un contrato de servicios con Editora Urbana Ltda, para todos los efectos el presente documento de t&eacute;rminos y condiciones ser&aacute; aplicable para su unidad de negocio.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>Un cliente no puede publicar el mismo aviso m&aacute;s de una vez.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>No se permite la publicaci&oacute;n de lotes de cementerio.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>No se permite la publicaci&oacute;n de inmuebles con embargo de cualquier tipo.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>No se permite la publicaci&oacute;n de minas y/o cualquier terreno o propiedad en zona arqueol&oacute;gica, lugares o sitios p&uacute;blicos.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>No se permite la publicaci&oacute;n de bienes fiscales, de la naci&oacute;n, entidades territoriales y entidades administrativas de cualquier tipo.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>No se permite la publicaci&oacute;n de documentos que acrediten la propiedad u otros derechos reales sobre bienes muebles o inmuebles.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>La descripci&oacute;n del aviso no debe contener:<br /><br /><br /></li>\r\n<ul>\r\n<li>Informaci&oacute;n de contacto sobre el ofertante del aviso u otra persona o entidad.</li>\r\n<li>Enlaces o Links.</li>\r\n<li>Correos &ndash; tel&eacute;fonos.</li>\r\n<li>Cuentas bancarias.</li>\r\n</ul>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>Las fotograf&iacute;as que se deseen publicar no podr&aacute;n contener:<br /><br /><br /></li>\r\n<ul>\r\n<li>N&uacute;meros de tel&eacute;fono</li>\r\n<li>Marcas de agua o logos de otros portales.</li>\r\n<li>Correos electr&oacute;nicos.</li>\r\n<li>Fotos descargadas de internet.</li>\r\n<li>Foto sugerentes de cuerpos desnudos o semi-desnudos.</li>\r\n<li>Fotos donde aparezcan menores de edad.</li>\r\n</ul>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>El aviso clasificado deber&aacute; comenzar con una palabra alusiva al bien que se ofrece o que se busca, si se trata de vivienda, por el barrio. En ning&uacute;n caso el clasificado podr&aacute; comenzar con n&uacute;meros, art&iacute;culos, signos o abreviaturas. Todos los clasificados se encuentran sujetos a modificaci&oacute;n de acuerdo con las normas de publicaci&oacute;n.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>Para los casos en los que el cliente cuente con un micrositio, &eacute;ste no podr&aacute; contener:<br /><br /><br /></li>\r\n<ul>\r\n<li>URLs o links</li>\r\n<li>Banners con publicidad relacionada a algo diferente de la venta y/o arriendo de inmuebles que est&eacute;n publicados en&nbsp;<a href=\"https://www.fincaraiz.com.co/\">WWW.ROCAROMANA.CO</a>&nbsp;en su portal web-m&oacute;vil o aplicaciones (Android e IOS)</li>\r\n<li>Datos o informaci&oacute;n que tenga como objetivo promover negocios diferentes a la venta y/o arriendo de inmuebles que est&eacute;n publicados en&nbsp;<a href=\"https://www.fincaraiz.com.co/\">WWW.ROCAROMANA.CO</a>&nbsp;en su portal web-m&oacute;vil o aplicaciones (Android e IOS).</li>\r\n</ul>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>Para los casos en los que el cliente publique videos (clientes particulares no cuentan con este servicio) &eacute;ste no podr&aacute; contener:<br /><br /><br /></li>\r\n<ul>\r\n<li>Informaci&oacute;n de inmuebles que no est&eacute;n publicados en&nbsp;<a href=\"https://www.fincaraiz.com.co/\">WWW.ROCAROMANA.CO</a>&nbsp;portal web-m&oacute;vil y aplicaciones (Android e IOS)</li>\r\n<li>Anuncios o informaci&oacute;n que tenga como objetivo promover negocios diferentes a la venta y/o arriendo de inmuebles que est&eacute;n publicados en&nbsp;<a href=\"https://www.fincaraiz.com.co/\">WWW.ROCAROMANA.CO</a>&nbsp;en su portal web-m&oacute;vil o aplicaciones (Android e IOS).</li>\r\n</ul>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br />WWW.ROCAROMANA.COM tiene la potestad de eliminar cualquier aviso que viole una o varias de estas reglas con el fin de garantizar la calidad de la informaci&oacute;n del portal. Cuando resulte evidente que el usuario est&aacute; evadiendo la pol&iacute;tica de publicaci&oacute;n o la tipolog&iacute;a de los servicios ofrecidos en la oficina virtual para acceder a otros servicios ofrecidos, ROCA ROMANA tendr&aacute; la potestad de actuar de acuerdo con el incumplimiento de las obligaciones del usuario.</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<li>Evasi&oacute;n de estructura de productos<br /><br /><br /></li>\r\n</ol>\r\n</ol>\r\n<p>Se considera evasi&oacute;n la publicaci&oacute;n de inmuebles vacacionales en arriendo, creaci&oacute;n de m&uacute;ltiples cuentas para la publicaci&oacute;n de avisos y la publicaci&oacute;n de fotograf&iacute;as con marcas que se asemejen o que busquen diferenciaci&oacute;n visual dentro de las listas de inmuebles.</p>\r\n<p><br /><br /></p>\r\n<p>Estas evasiones llevar&aacute;n un cobro a la persona registrada como titular de la cuenta del costo del producto que se est&aacute; intentando evadir.</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<li>Comportamientos no autorizados y/o prohibidos por parte de los usuarios<br /><br /><br /></li>\r\n<ol>\r\n<li>No es permitido realizar Crawling y scraping de las p&aacute;ginas web de ROCAROMANA.CO y todos sus subdominios, del portal web y de las aplicaciones (Android e IOS) por medio de robots o spiders que no est&eacute;n expl&iacute;citamente autorizados en el archivo www.rocaromana.com</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>No es permitido copiar avisos ofrecidos por&nbsp;<a href=\"https://www.fincaraiz.com.co/\">WWW.ROCAROMANA.CO</a>&nbsp;en su portal web-m&oacute;vil y/o aplicaciones (Android e IOS) para republicarlos en otros portales.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>No es permitido copiar ning&uacute;n tipo de informaci&oacute;n disponible en&nbsp;<a href=\"https://www.fincaraiz.com.co/\">WWW.ROCAROMANA.CO</a>&nbsp;en su portal web-m&oacute;vil y/o aplicaciones (Android e IOS) con fines comerciales diferentes a la negociaci&oacute;n del inmueble espec&iacute;fico.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>No es permitido contactar a los anunciantes de avisos publicados en&nbsp;<a href=\"https://www.fincaraiz.com.co/\">WWW.ROCAROMANA.CO</a>&nbsp;en su portal web-m&oacute;vil y/o aplicaciones (Android e IOS) con un fin diferente a la compra, venta o arrendamiento del inmueble.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>No es permitido extraer informaci&oacute;n de&nbsp;<a href=\"https://www.fincaraiz.com.co/\">WWW.ROCAROMANA.CO</a>&nbsp;en su portal web-m&oacute;vil y/o aplicaciones para realizar construcci&oacute;n de base de datos con fines comerciales y/o difusi&oacute;n masiva de informaci&oacute;n o publicidad.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>No es permitido revender los servicios prestados por&nbsp;<a href=\"https://www.fincaraiz.com.co/\">WWW.ROCAROMANA.CO</a>&nbsp;en su portal web-m&oacute;vil y/o aplicaciones (Android e IOS) o utilizarlos para operar como intermediario, canal o medio de comunicaci&oacute;n. Queda expresamente prohibido que EL CLIENTE utilice su oficina virtual, sus cuentas de acceso al PORTAL, o en general los servicios contratados con&nbsp;<a href=\"https://www.fincaraiz.com.co/\">WWW.ROCAROMANA.CO</a>, para prestar los mismos servicios a terceras personas, bien sea de forma gratuita u onerosa, como un servicio independiente o complementario a otras actividades</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<ol>\r\n<li>No se otorga autorizaci&oacute;n o licencia para que EL CLIENTE utilice o se aproveche de las marcas, signos, nombres comerciales o la raz&oacute;n social de ROCA ROMANA .o sus empresas vinculadas; de manera que EL CLIENTE no podr&aacute; usar las marcas, signos, nombres comerciales o la raz&oacute;n social de ROCA ROMANA, incluso a trav&eacute;s del empleo de v&iacute;nculos o enlaces en Internet.</li>\r\n</ol>\r\n</ol>\r\n</ol>\r\n<p><br /><br /></p>\r\n<ol>\r\n<li>Facturaci&oacute;n:<br /><br /><br /></li>\r\n</ol>\r\n<p>ROCA ROMANA,ofrece a trav&eacute;s de WWW.ROCAROMANA.CO en su portal web-m&oacute;vil y/o aplicaciones (Android e IOS) servicios y productos gratuitos y de pago. En este sentido, cuando los servicios y/o productos adquiridos por un cliente o usuario generen cobros por parte de&nbsp; ROCA ROMANA S.A.S, &eacute;sta emitir&aacute; la correspondiente factura, la cual, de acuerdo a los t&eacute;rminos y condiciones aceptados por las partes (ROCA ROMANA&nbsp; y el usuario persona natural o jur&iacute;dica que acepta los t&eacute;rminos y condiciones), se realizar&aacute; bajo el siguiente acuerdo de expedici&oacute;n y aceptaci&oacute;n de facturas electr&oacute;nicas:</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<li>INICIO DE OPERACIONES.&nbsp;</li>\r\n</ol>\r\n</ol>\r\n<p>Las partes acuerdan que la vigencia de &eacute;ste inicia con la facturaci&oacute;n siguiente a la fecha en que se acepta este acuerdo.</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<li>CAUSALES DE TERMINACI&Oacute;N.&nbsp;</li>\r\n</ol>\r\n</ol>\r\n<p>El presente acuerdo tendr&aacute; una duraci&oacute;n indefinida. Sin embargo, podr&aacute; darse por terminado por cualquiera de las partes, previo aviso dado por escrito a su contraparte con 30 (treinta) d&iacute;as calendario de anticipaci&oacute;n.</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<li>INTERVINIENTES EN EL PROCESO.&nbsp;</li>\r\n</ol>\r\n</ol>\r\n<p>Los intervinientes en el proceso se definen a continuaci&oacute;n:</p>\r\n<p><br /><br /><br /></p>\r\n<p>EL OBLIGADO A FACTURAR:&nbsp;Es la persona natural o jur&iacute;dica que conforme a las normas tributarias tiene la obligaci&oacute;n de facturar, y que trat&aacute;ndose de la factura electr&oacute;nica, la expide, gener&aacute;ndola y numer&aacute;ndola por medio de un sistema de facturaci&oacute;n por computador en los t&eacute;rminos del art&iacute;culo 13 (3) del Decreto 1165 de 1996 o las normas que lo modifiquen, entreg&aacute;ndola al adquirente y conserv&aacute;ndola para su posterior exhibici&oacute;n, en los t&eacute;rminos que se establecen en Decreto 2242 de 2015 y la Resoluci&oacute;n 19 de 2016.</p>\r\n<p>EL ADQUIRENTE:&nbsp;Es la persona natural o jur&iacute;dica que como adquirente de bienes o servicios debe exigir factura o documento equivalente y, que trat&aacute;ndose de la factura electr&oacute;nica, la acepta y conserva para su posterior exhibici&oacute;n, en los t&eacute;rminos que se establecen en el Decreto 2242 de 2015 y la Resoluci&oacute;n 19 de 2016.</p>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<ol>\r\n<li>PROCEDIMIENTOS DE EXPEDICI&Oacute;N, ENTREGA, ACEPTACI&Oacute;N/RECHAZO, CONSERVACI&Oacute;N Y EXHIBICI&Oacute;N:&nbsp;</li>\r\n</ol>\r\n</ol>\r\n<p>EL PROVEEDOR TECNOL&Oacute;GICO ofrece a EL OBLIGADO A FACTURAR y a EL ADQUIRENTE un servicio virtual (portal e-Bill) a trav&eacute;s del cual &eacute;stos podr&aacute;n llevar a cabo las siguientes operaciones haciendo uso de los identificadores de usuario y clave que les ser&aacute;n asignadas, realizando un procedimiento de autenticaci&oacute;n SSO.</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<li>PROCEDIMIENTO DE CONTINGENCIA APLICABLE:&nbsp;</li>\r\n</ol>\r\n</ol>\r\n<p>Cuando se presenten situaciones que no permitan llevar a cabo los procedimientos de factura electr&oacute;nica, EL OBLIGADO A FACTURAR tiene definidos procedimientos manuales usando el prefijo establecido por la DIAN.</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<li>RESPONSABILIDADES:&nbsp;</li>\r\n</ol>\r\n</ol>\r\n<p>Es responsabilidad de EL ADQUIRENTE rechazar la factura por los medios disponibles por este &uacute;ltimo (correo electr&oacute;nico) y/o los medios que EL OBLIGADO A FACTURAR le comunique a EL ADQUIRENTE son oficiales para este tr&aacute;mite. Sin perjuicio de lo establecido en la Ley 1231 de 2008 y su Decreto Reglamentario n&uacute;mero 3323 de 2009 y de acuerdo con lo establecido en la Ley 1676 de 2013, particularmente lo contenido en el art&iacute;culo 86 de esta &uacute;ltima Ley, el cual modific&oacute; el inciso tercero del art&iacute;culo segundo de la Ley 1231 de 2008, si el adquirente dentro de los tres (3) d&iacute;as h&aacute;biles siguientes al recibo de la factura no reclamare en contra de su contenido, se entender&aacute; que la misma es irrevocable y t&aacute;citamente aceptada. En este sentido, el obligado a facturar, declara bajo la gravedad del juramento que para efectos de endoso de la factura, se aplicaron los presupuestos de la aceptaci&oacute;n t&aacute;cita.</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<li>El acuerdo de facturaci&oacute;n&nbsp;</li>\r\n</ol>\r\n</ol>\r\n<p>se har&aacute; vigente desde el momento de la aceptaci&oacute;n de los t&eacute;rminos y condiciones del portal por parte del usuario &ndash; ADQUIRENTE.</p>\r\n<p><br /><br /></p>\r\n<ol>\r\n<ol>\r\n<li>La plataforma&nbsp;</li>\r\n</ol>\r\n</ol>\r\n<p>podr&aacute; poner a su disposici&oacute;n m&eacute;todos de pago electr&oacute;nicos para el pago de los servicios contratados, dichos m&eacute;todos de pago corresponden a p&aacute;ginas especializadas administradas por terceros con reconocimiento en el mercado. ROCA ROMANA no ser&aacute; responsable de ninguna de las operaciones que EL USUARIO efect&uacute;e estando dentro de las plataformas de pago administradas que son por terceros ajenos a ROCA ROMANA</p>\r\n<p>&nbsp;</p>',NULL,'2025-09-26 20:24:33'),(11,'company_tel1','3001001010',NULL,'2025-02-03 19:50:42'),(12,'company_tel2','3001001010',NULL,'2025-02-03 19:50:42'),(13,'razorpay_gateway','0',NULL,NULL),(14,'paystack_gateway','0',NULL,NULL),(15,'paypal_gateway','0',NULL,'2024-07-30 19:56:47'),(16,'system_version','1.1.5',NULL,NULL),(17,'company_logo','logo.png',NULL,'2025-06-05 16:28:50'),(18,'web_logo','logoRR.jpg',NULL,'2025-09-12 12:43:38'),(19,'favicon_icon','favicon.png',NULL,'2025-06-05 16:28:02'),(20,'web_footer_logo','logoRR.jpg',NULL,'2025-09-12 12:43:38'),(21,'web_placeholder_logo','logoRR.jpg',NULL,'2025-09-12 12:43:38'),(22,'splash_logo','splash.svg',NULL,NULL),(23,'app_home_screen','homeLogo.svg',NULL,NULL),(24,'company_email','soporte@rocaromana.com','2024-07-25 20:57:53','2024-07-27 19:17:02'),(25,'latitude','6.242850','2024-07-25 20:57:53','2024-07-27 19:17:02'),(26,'longitude','-75.565720','2024-07-25 20:57:53','2024-07-27 19:17:02'),(27,'company_address','Carrera 43a #11a-44','2024-07-25 20:57:53','2024-07-27 19:17:02'),(28,'unsplash_api_key',NULL,'2024-07-25 20:57:53','2024-07-25 20:57:53'),(29,'place_api_key','AIzaSyAPf-_f8rRDaWIjESOXsTJxhH0Mys3eiWo','2024-07-25 20:57:53','2024-09-26 13:12:16'),(30,'svg_clr','0','2024-07-25 20:57:53','2024-07-25 20:57:53'),(31,'playstore_id','#','2024-07-25 20:57:53','2024-08-05 15:33:46'),(32,'appstore_id','#','2024-07-25 20:57:53','2024-08-05 15:33:46'),(33,'system_color','#858585','2024-07-25 20:57:53','2024-12-07 02:12:50'),(34,'rgb_color','rgb(133, 133, 133,0.15)','2024-07-25 20:57:53','2024-12-07 02:12:50'),(35,'paypal_business_id','ZXWLL47FUEL5A','2024-07-25 20:57:54','2024-07-30 19:55:18'),(36,'paypal_webhook_url','http://admin.rocaromana.com/webhook/paypal','2024-07-25 20:57:54','2024-07-25 20:57:54'),(37,'sandbox_mode','1','2024-07-25 20:57:54','2024-07-30 1